void* __RelativeAddress(int offset)
{
	for (ADDRESS_ENTRY const& addressEntry : s_AddressEntries)
	{
		if (addressEntry.offset == offset)
		{
			void* address = const_cast<void*>(addressEntry.address);
			if (addressEntry.isPointerToPointer)
			{
				address = *reinterpret_cast<void**>(address);
			}
			if (address == nullptr)
			{
				__debugbreak(); throw;
			}
			return address;
		}
	}
	__debugbreak(); throw;
}

